import java.text.SimpleDateFormat;
if((${Applicant_Card_Validity}.equals("9999")) || (${Apply_Date}.equals("9999"))){
	return false;
}
Date olddate = (new SimpleDateFormat("yyyy-MM-dd")).parse(${Applicant_Card_Validity});
Date newdate = (new SimpleDateFormat("yyyy-MM-dd")).parse(${Apply_Date});
if(olddate >= newdate){
	return false;
}else{
	return true;
}
